import React from 'react';
import OptionEditable from '../components/OptionEditable'



const PegsDisplay = () => {
    console.log([...Array(110)]);
    const array=Array(110)
    return (
        <>
            <h1> My Pegs!</h1>
            <div>

            {
                array.map( index => (
                    <OptionEditable id={index} />
                    // <h2>{index}</h2>
                    ))
                }
                </div>
            <OptionEditable id={90} />
        </>
    )
};

export default PegsDisplay;
